import './App.css';
import HomeTitle from './components/hometitle';
import TextEng from './components/texteng';
import IntroEng from './components/introeng';
import IntroKor from './components/introkor';
import TextKor from './components/textkor';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <HomeTitle />

        <div className='fixed flex justify-end w-full'>
          <ul className='text-lg font-grotesk bg-gray'>
            <li>up</li>
            <li>work</li>
          </ul>
        </div>

        <section className='flex w-full'>
          <div className='w-2/5'>
          < IntroEng />
          </div>

          <div className='w-2/5'>
          < IntroKor />
          </div>
        </section>

        <section className='flex w-full'>
          <div className='w-2/5'>
          < TextEng />
          </div>

          <div className='w-2/5'>
          < TextKor />
          </div>
        </section>

      </header>
    </div>
  );
}

export default App;
